import React from 'react'

function Main() {
    const card = {
        name:"Ahmed",
        age:38,
        adress:"Egypt",
        education:"High school"
    }
    return (
        <>
            <h3 id='AHR'>
             Your Name is{card.name}
            </h3>    
    </>
  )
}

export default Main
